import React, { Component,useState,useEffect } from "react";
import MyCarousal from "../../components/my-carousal/my-carousal.component";
import MyCarousal1 from "../../components/my-carousal/my-carousal1.component";
import MyTitleMessage from "../../components/title-message/title-message.component";

//profile Picture
import ExampleComponent from "react-rounded-image";
import profilePictureImage from '../../assests/img/profile/linkedin-photo.jfif';
import styles from  './home.module.css';
import ProfilePicture from "../../components/profilePicture/profilePicture.component";
import HeroSection from '../../components/HeroSection/HeroSection.components';

import scrollDown from '../../components/scrollDown/scrollDown.component';


import aboutMeVideo from '../../assests/video/aboutMeVideo.webm';

// SVG ICONS
// <svg width="40px" height="100%" viewBox="0 0 247 390" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" style="fill-rule:evenodd;clip-rule:evenodd;stroke-linecap:round;stroke-linejoin:round;stroke-miterlimit:1.5;">
{/* <path id="wheel" d="M123.359,79.775l0,72.843" style="fill:none;stroke:#fff;stroke-width:20px;" /> */ }
//
// </svg >
// <p>Scroll down</p>
const SvgIcon = () => (<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 247 390" width="40px" height="100%" preserveAspectRatio="none">
    <g transform="translate(0,0)">
        <path id="wheel" d="M123.359,79.775l0,72.843" fill="#FFF" stroke="#FFF" stroke-width="20px" />
        <path id="mouse" fill="none" stroke="#fff" stroke-width="20px" d="M236.717,123.359c0,-62.565 -50.794,-113.359 -113.358,-113.359c-62.565,0 -113.359,50.794 -113.359,113.359l0,143.237c0,62.565 50.794,113.359 113.359,113.359c62.564,0 113.358,-50.794 113.358,-113.359l0,-143.237Z" />

    </g>
</svg>)




class Home extends Component {

    render() {
        return (
            <div className={styles.pageBackground}>
                <div>
                    <MyCarousal />
                    <div className={styles.Content}>
                        <ExampleComponent
                            image={profilePictureImage}
                            roundedColor="#FFF"
                            imageWidth="200"
                            imageHeight="200"
                            roundedSize="10"
                        />
                    </div>
                    <MyTitleMessage />
                    <div style={{
                        height: '25%',
                        width: '100%',
                        position: 'fixed'
                    }} className="size">
                        <SvgIcon />
                    </div>
                </div>
                <div className={styles.About_me}>
                    <MyCarousal1 />
                    <div className={styles.about_content}>
                        <HeroSection />
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
